import React, { useState, useEffect, ReactElement } from "react";
import { TouchableOpacity } from "react-native";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../../styles";

import HomeList from "./HomeList";
import Profile from "../Profile/Profile";

const HomeDiv = styled(View)`
  flex: 1;
`;

const HomeBottom = styled(View)`
  background-color: #ccc;
  height: 60px;
  flex-direction: row;
  color: #fefefe;
`;

const NavButton = styled(TouchableOpacity)`
  flex: 1;
  background-color: #212121;
`;

export default function Home(): ReactElement {
  const [profileActive, setProileActive] = useState(true);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos/1")
      .then((raw) => raw.json())
      .then((data) => {
        console.log(data);
      });
  }, []);

  return (
    <HomeDiv>
      {profileActive ? <Profile /> : <HomeList />}
      <HomeBottom>
        <NavButton onPress={() => setProileActive(false)}>Chat</NavButton>
        <NavButton onPress={() => setProileActive(true)}>Profile</NavButton>
      </HomeBottom>
    </HomeDiv>
  );
}
